import React from 'react';
import './App.css';
import Headers from './Headers'
import Article from './Article'
import Footer from './Footer'




function App (props) {
  return (
    <div className="container-fluid">
      {/* <nav className="navbar navbar-expand-md navbar-dark bg-dark">

        <a className="navbar-brand" href="#"><i class="fas fa-hospital-user"></i>&nbsp;Sa√∫de e Mapeamento</a>

       <div className="collapse" id="navbarMainToggler">
          <div className="navbar-nav">
            <a className="nav-item nav-link" href="#">Inicio</a>
            <a className="nav-item nav-link" href="#">Dicas</a>
            <a className="nav-item nav-link" href="#">Feedback</a>
          </div>
        </div>
        
        

        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarMainToggler" aria-controls="navbarMainToggler" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        </nav> */}

<nav class="navbar navbar-expand-lg navbar-light bg-light">
  <a class="navbar-brand" href="#">Navbar</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarNav">
    <ul class="navbar-nav">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Features</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Pricing</a>
      </li>
      <li class="nav-item">
        <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
      </li>
    </ul>
  </div>
</nav>


      </div>


    // <div>
    //         {/* <Headers /> */}
    //         {/* <Article />
    //         <Footer /> */}
    //       </div>
    
  );
};


export default App;
